class Home extends Component {
    render() {
        return (
            <React.Fragment>
                {/* <Navbar/> */}
                <Greet/>
                <TypeWriterC/>
                <Cards/>
                <Footer/>
            </React.Fragment>
        );
    }
}

export default Home;
